import React from 'react'
import { Table } from 'react-bootstrap';

const MainTable = ({ tbody, thead }) => {

    var table = {}
    var val = '';
    table.thead = thead.thead;
    table.tbody = tbody.tbody;

    return (
        <Table striped bordered hover>
            <thead>
                <tr>

                </tr>
            </thead>
            <tbody>
                {table.tbody.map( function(ele) {
                    return (<tr>{
                        table.thead.map( function(index) {
                            return(<td>{ele[index]}</td>)
                        } )
                    }</tr>)
                } )}
            </tbody>
      </Table>
    )
}

export default MainTable
